¡Si usted tiene que comprobar su sonido, mire esta herramienta útil! La aplicación Sound Check - Prueba De Sonido está diseñada para generar sonido con varias frecuencias, desde muy baja a muy alta. ¡Con esta buena utilidad usted puede comprobar fácilmente la calidad sonora de sus audífonos o sólo hacer algún ruido!

Los rasgos generales de la aplicación Sound Check - Prueba De Sonido:
- una amplia gama disponible de frecuencia de onda;
- 4 tipos de ondas de las que elegir: seno, diente de sierra, triángulo, y plana;
- un generador práctico de sonidos diferentes y ruidos.

¡Esta aplicación puede ser una herramienta de comprobación para cualquier audífono que usted esté a punto de comprar, pero quiere comprobar la calidad del sonido de repente, o una aplicación genial para todos los que aman lidiar con sonidos, ondas sonoras, y efectos sonoros!

